import React,{useState, useEffect} from 'react';
import {Section, Title, Main, Image, Info, Bullets} from './styles'
import getLatestLaunch from "../../services/getLatestLaunch";

const Latest = () => {

const [latest, setLatest] = useState({})

useEffect(() => {
  getLatestLaunch().then((data) => setLatest({...data}));

}, []);

console.log(latest)

  return (
    <Section>
      <Title>
        <h2>latest mission</h2>
      </Title>
      <Main>
        <Image>
          <figure>
            <img src={"./images/escudo.png"} />
          </figure>
        </Image>
        <Info>
          <h3>{latest.name}</h3>
          <p>
            {latest.details}
          </p>
        </Info>
        <Bullets>
          <p>Date: november 10</p>
          <p>site: november 10</p>
          <p>rocket: november 10</p>
        </Bullets>
      </Main>
    </Section>
  );
};

export default Latest;
